import react from "react"

  function Header({ selectUser }){

    console.log(selectUser)
    if(selectUser === ""){
      console.log(1)
    }else if(selectUser == {}){
      console.log(2)
    }else{
      console.log(3)
    }

  return(
    <div id="header">
        <h1>{`Welcome to ${selectUser.username}'s Art Gallery`}</h1>
    </div>
  )
}

export default Header;
